import logo from './logo.svg';
import {
  BrowserRouter,
  Routes,
  Route,
} from 'react-router-dom';
import styles from './App.css';

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Start />} />
        </Routes>
      </BrowserRouter>
    </>
  );
}

const Start = () => {
  return (
    <>
      <div className={styles.header}>
        <p>Welcome!</p>
        <a>Let's Start!</a>
      </div>
    </>
  )
}

export default App;
